import React from 'react';


export const LibrarySong = ({ song }) => {
    return (
        <div className="librarySong">
            <img src={song.cover} alt="portada"></img>
            <h3>{song.name}</h3>
            <h4>{song.artist}</h4>
        </div>
    );
}
